import { createPortal } from "react-dom";

const Modal = ({ isOpened }) => {
  if (!isOpened) {
    return null;
  }
  return createPortal(
    <div>
      <div className="overlay"></div>
    </div>,
    document.getElementById("modal")
  );
};

export default Modal;
